import React from 'react';
import axios from 'axios';
import { Redirect } from 'react-router';
import { Link } from 'react-router-dom';
import {useLocation} from "react-router-dom";
import Plot from "./Plot.js"
class Settings  extends React.Component {
	constructor(props){
    	super(props);
    	this.state = {
            id: -1,
      		new_email_address:"",
      		Password:"",
      		new_password:"",
      		new_password_again:"",
      		con:true,
    	};
    	if(props.location.state == null){
    		this.state.con=false	
    	}
    	else{
    		this.state.con=true
    		this.state.email_address=props.location.state.Email
    		this.state.id=props.location.state.id
    	}
  	}
  	handleEmail(e){
  		this.setState({new_email_address: e.target.value});
  	}
  	handlePassword_onchange_Email(e){
  		this.setState({Password: e.target.value});
  	}
  	check_Types(){
  		if(this.state.new_email_address !== null && this.state.new_email_address !== '') {
	      this.state.con=true;
	    }
	    else{
	      alert('Empty email')
	      this.state.con=false;
	    }
	    if(this.state.Password !== null && this.state.Password !== '') {
	      this.state.con=true;
	    }
	    else{
	      alert('Empty Password')
	      this.state.con=false;
	    }
  	}
  	handleClickOne(e){
  		const formData = new FormData();
    formData.append('email',this.state.email);
    formData.append('Password',this.state.Password);
  	}
  	handle_Change_Email(e){
  		this.check_Types()
  		 if(this.state.con==true){
      		this.handleClickOne()
   		}
  	}
	render(){
		if(this.state.con === false){
  			return (<Redirect to='/'/>);
  		}
  		else{
			return(
				<div>
					<Plot name={"Settings"} id={this.state.id} email={this.state.email_address}/>
					 <h4>Change Email</h4>
					 <form onSubmit={this.handle_Change_Email}>
			          <label>New Email Address:</label>
			          <input type="text"  id="Email" name="Email" defaultValue={this.state.new_email_address}  onChange={this.handleEmail} size="61"/><br/>
			          <label for="Password">Password:</label>
			          <input  type="password" id="Password" name="Password" defaultValue={this.state.Password}  onChange={this.handlePassword_onchange_Email}  size="69"/><br/><br/>
			          <button>Submit</button>
			        </form>
			        <br/>
			        <br/>
			        <br/>
			        <br/>
			        <br/>
			        <br/>
			        <br/>
			        <form>
			        <h4>Change Password</h4>
			        <label>Password:</label>
			        <input type="password"  id="password" name="password" defaultValue={this.state.email}  onChange={this.handleEmail} size="78"/><br/>
			        <label for="Password">New Password:</label>
			        <input  type="password" id="newPassword" name="newPassword" defaultValue={this.state.Password}  onChange={this.handlePassword}  size="74"/><br/>
					<label for="Password">New Password Again:</label>
			        <input  type="password" id="newPassword_again" name="newPassword_again" defaultValue={this.state.Password}  onChange={this.handlePassword}  size="69"/><br/><br/>
					<button>Submit</button>
					</form>
				</div>
			);
		}
	}
}
export default Settings;
